import {Container,Row,Col} from 'react-bootstrap'
import { CommentMedia, CustomMedia } from "./CommentMedia";
 
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlayCircle, faCalendarAlt } from "@fortawesome/free-solid-svg-icons";
import {Link} from 'react-router-dom'
import vendorVideo from '../../Api/VendorVideo';
 
export default function RelatedVideo() {
	return (
		<>
			 
             <div className="video-block section-padding ">
				<Row>
					 


			 
                <Col xl={3} sm={6} className="mb-3" >
                 
               {  vendorVideo.map((vendor)=>{
                  {
                      console.log("this is from related", vendor);
                  }
               })}
                </Col>
              
					 
				</Row>
			</div>
					 
				 
		  
		</>
	);
}


const RelatedVideoCard=(props)=>{
    const { title,time,videoTitleHref,url,shopUrl,videoTitle,videoCategories,shop,views,timeAgo,video,iconHref,imgAlt,imgHref,imgSrc}=props.vendor;
 
 

	
	return (
		<>
	{
        console.log("this is related Video,", props.vendorVideo)
    }
	        
			<div className="video-card">
			 
				<div className="video-card-image">
					<Link className="play-icon" to='#'>
						<FontAwesomeIcon icon={faPlayCircle} />
					</Link>
					<Link to={imgHref}>
						<img className="img-fluid" src="#" alt="#" />
					</Link>
				 
				</div>
				<div className="video-card-body">

					<div className="video-title">
						<Link to="#"  >title}</Link>
					</div>

					<div
						
					> 
					<a style={{color:'#28a745', fontWeight:'700'}} >	 shop </a>
						    
					</div>
					<div className="video-view">
					
					</div>
					<div>
						      
					</div>
					<hr/>
					 
				</div>
			</div>
		</>
	);
}
